    Avatar,
    Box,
    Button,
    Divider,
    Drawer,
    Hidden,
    List,
    Typography,
    makeStyles,
    ListItemText,
    Grid
} from '@material-ui/core';

import NavBar from "../components/NavBar/NavItem"
import MenuBar from "../components/SideBar/MenuBar"
import CustomerListView from '../pages/CustomerListView'

const user = {
    avatar: '/static/images/avatars/avatar_6.png',
    jobTitle: 'Senior Developer',
    name: 'Katarina Smith'
};




const content = (
    <Box
        height="100%"
        display="flex"
        flexDirection="column"
    >
        <Box
            alignItems="center"
            display="flex"
            flexDirection="column"
            p={2}
        >

            <Typography
                color="textPrimary"
                variant="h5"
            >
                {user.name}
            </Typography>
            <Typography
                color="textSecondary"
                variant="body2"
            >
                {user.jobTitle}
            </Typography>
        </Box>
        <Divider />
        <Box p={2}>
            {/* <List>
                {items.map((item) => (
                    <NavItem
                        href={item.href}
                        key={item.title}
                        title={item.title}
                        icon={item.icon}
                    />
                ))}
            </List> */}
        </Box>


    </Box>
);


const Management = () => {


    return (
        <div>
            <Grid>
                <Box >
                    <Grid container justify="center" >
                        <Grid item xs="2">

                            <Box >
                                <MenuBar></MenuBar>
                            </Box>

                        </Grid>
                        <Grid item xs="10">
                            <CustomerListView></CustomerListView>
                        </Grid>

                    </Grid>
                </Box>
            </Grid>



        </div>
    );
};

export default Management;
